import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import PropTypes from 'prop-types';
import Time from './time';

function FileList({ file }) {
    return (
        <table>
            <tr>
                <td>//FileName //FileIcon //CommitMessage //Time</td>
            </tr>
        </table>
    );
}

function FileIcon({ file }) {
    return <div>if (file.icon === 'folder')</div>;
}

function FileName() {}

const testFiles = [
    {
        id: 1,
        name: 'src',
        type: 'folder',
        updated_at: '2016-07-11 21:24:00',
        latestCommit: {
            message: 'Initial commit'
        }
    },
    {
        id: 2,
        name: 'tests',
        type: 'folder',
        updated_at: '2016-07-11 21:24:00',
        latestCommit: {
            message: 'Initial commit'
        }
    },
    {
        id: 3,
        name: 'README',
        type: 'file',
        updated_at: '2016-07-18 21:24:00',
        latestCommit: {
            message: 'Added a readme'
        }
    }
];

ReactDOM.render(<FileList file={testFiles} />, document.querySelector('#root'));
